export default [
  {
    id: 'dashboards',
    title: 'Dashboards',
    icon: <Home size={20} />,
    badge: 'light-warning',
    navLink:'/dashboard/detail'
  },
      {
        id: 'analyticsDash',
        title: 'Master',
        icon: <Circle size={12} />,
        navLink: '/dashboard/master',
        children:[
          {
            id: 'eCommerceDash',
            title: 'User',
            icon: <Circle size={12} />,
            navLink: '/dashboard/user'
          },
          {
            id: 'eCommerceDash',
            title: 'Country Master',
            icon: <Circle size={12} />,
            navLink: '/dashboard/countrymaster'
          },
          {
            id: 'eCommerceDash',
            title: 'State Master',
            icon: <Circle size={12} />,
            navLink: '/dashboard/statemaster'
          },
        ]
      }


]
